function isTouchEnabled() {
    return (('ontouchstart' in window) || (navigator.MaxTouchPoints > 0) || (navigator.msMaxTouchPoints > 0))
}
// -----------------------------------------------
// Rotation card
// -----------------------------------------------
$(document).ready(function () {
    $('#bck_base').hide().animate({
        'opacity': '0'
    }, 300);
    $('.go_bck').on('click', function () {
        $('#frt_base').hide().animate({
            'opacity': '0'
        }, 300);
        $('#bck_base').show().animate({
            'opacity': '1'
        }, 300)
    });
    $('#side_base').hide().animate({
        'opacity': '0'
    }, 300);
    $('.go_side').on('click', function () {
        $('#frt_base').hide().animate({
            'opacity': '0'
        }, 300);
        $('#side_base').show().animate({
            'opacity': '1'
        }, 300)
    });
    $('.go_frt').on('click', function () {
        $('#bck_base').hide().animate({
            'opacity': '0'
        }, 300);
        $('#frt_base').show().animate({
            'opacity': '1'
        }, 300)
    })
});

