$(function () {
    var points_len = side_spots.spots.length;
    if (points_len > 0) {
        var xmlns = "http://www.w3.org/2000/svg";
        var tsvg_obj = document.getElementById("side_spots");
        var svg_circle;
        for (var i = 0; i < points_len; i++) {
            svg_circle = document.createElementNS(xmlns, "circle");
            svg_circle.setAttributeNS(null, "cx", side_spots.spots[i].pos_X);
            svg_circle.setAttributeNS(null, "cy", side_spots.spots[i].pos_Y);
            svg_circle.setAttributeNS(null, "r", side_spots.spots[i].diameter / 2);
            svg_circle.setAttributeNS(null, "fill", side_spots.spots[i].upColor);
            svg_circle.setAttributeNS(null, "fill-opacity", side_spots.spots[i].upOpacity);
            svg_circle.setAttributeNS(null, "stroke", side_spots.spots[i].outlineUpColor);
            svg_circle.setAttributeNS(null, "stroke-opacity", side_spots.spots[i].outlineUpOpacity);
            svg_circle.setAttributeNS(null, "id", 'side_spots_' + i);
            tsvg_obj.appendChild(svg_circle);
            dynamicside_addEvent(i)
        }
    }
});

